void compareResults(Results results, const char ** strings, int count, int score, const char * msg) {

	if (results.Count != count) {
		std::cout << "Mismatch in count" << std::endl;
		std::cout << msg << ": counts: " << results.Count << " vs " << count << std::endl;
		return;
	}

	if (results.Score != score) {
		std::cout << "Mismatch in Scores" << std::endl;
		std::cout << msg << ": scores: " << results.Score << " vs " << score << std::endl;
		return;
	}

	std::sort(const_cast<const char**>(results.Words), const_cast<const char**>(results.Words) + results.Count, [](const char* a, const char* b) { return strcmp(a, b) < 0; });
	std::sort(strings, strings + results.Count, [](const char * a, const char * b) { return strcmp(a, b) < 0; });

	for (auto i = 0; i < count; i++) {
		if (strcmp(results.Words[i], strings[i]) != 0) {
			std::cout << msg << ": strings: " << results.Words[i] << " vs " << strings[i] << std::endl;
			return;
		}
	}

	std::cout << msg << "Board Passed" << std::endl;
}

